import { useEffect, useState } from "react"
import { useParams } from "react-router-dom";

import CountryPage_Header from "../components/CountryPage_Header"

export default function CountryPage() {
    const {country, code} = useParams()
    const [countryInfo, setCountryInfo] = useState([]);
    console.log(`${process.env.REACT_APP_GET_COUNTRY_INFO_BASE_URL}?code=${code}&country=${country}`)
    useEffect(() => {
        fetch(`http://localhost:3000/api/getCountryInfo?code=${code}&country=${country}`)
        .then(response => {
            if(!response.ok) {
                throw new Error(response.status)
            }
        })
        .then(data => {
            setCountryInfo(data)
        })
    }, [])
    return (<CountryPage_Header name={country} flag={countryInfo.flag}></CountryPage_Header>)
}
